exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`https://m.dushudu.com/list-dd-${bid}-1.html?rand${new Date().getTime().toString().substring(5)}`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/id="chapters_list[^>]+>/,"</dl>"),recordRegex:/href="(?<url>[^"]+)">(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)}})};